import './App.css';

import testLogo from './absolutemedialogo.png';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
} from "react-router-dom";

import HomePage from './HomePage';
import ProductPage from './product';

function App() {
  return (
    <div className="App">
    <Router>
            <Routes>
              <Route path = '/' element = {<HomePage/>} />
              //<Link to = "/" />
            </Routes>
          </Router>
    
    </div>
  )
}
export default App;
